import React from "react";
import style from "./survey.module.css";
import Link from "next/link";

const surveyQuestions = (props) => (
  <div className={style.containerSurvey}>
    <div>
      <h1>Ayudanos a encontrarle el terapeuta adecuado.</h1>
      <p>
        Complete este breve cuestionario para proporcionar algunos antecedentes
        generales y anónimos sobre usted y los problemas que le gustaría abordar
        en la terapia en línea. Nos ayudaría a encontrarle el terapeuta más
        adecuado para usted.
      </p>
    </div>
    <div className={style.questions}>
      <h2>
        ¿Siente que su salud mental se está viendo afectada por el brote de
        coronavirus?
      </h2>
    </div>
  </div>
);

export default surveyQuestions;
